import{_ as t,o as i,c as p,a7 as s,gm as a,gn as _,go as U,gp as r,gq as e,gr as m,gs as l,gt as J,gu as o,gv as y,gw as c,gx as M,gy as g,gz as d}from"./chunks/framework.nrF9sM7m.js";const O=JSON.parse('{"title":"10月25日·东部华侨城","description":"","frontmatter":{"title":"10月25日·东部华侨城","tags":["三洲田","东部华侨城","大梅沙"],"id":1056,"categories":["Life"],"abbrlink":"debe7510","date":"2008-10-27T13:08:41.000Z"},"headers":[],"relativePath":"Life/10月25日东部华侨城.md","filePath":"Life/10月25日东部华侨城.md","lastUpdated":1719711816000}'),T={name:"Life/10月25日东部华侨城.md"},V=s('<p>东部华侨城在深圳大梅沙和三洲田那块，从科技园坐车1小时即到大峡谷，从大峡谷进去，坐云海索道到山顶，上了旋转观光塔一饱风光之后，乘坐穿梭巴士前往茶溪谷</p><p>茶溪谷是07年对外开放的，设施已经很完善了。上次参加磨房百公里有经过茶溪谷门口，只是那次人非常多，加上是刷过去的，只停留片刻。（见 {% post_link &#39;Life/3月23日·磨房百公里&#39;%} ）</p><p>一直想看百万葵园，因为喜欢向日葵那种欣欣向荣的气息，喜欢那种乐观向上的态度，可惜那天没有大太阳，向日葵都垂着头，或许就像生活的不如意，但是雨过天晴总有灿烂的明天。</p><p>茶溪谷的山间小道路面非常爽，好遗憾没带上轮滑鞋，那里刷起来肯定很爽，起码不想走路那么累。</p><p>经过索桥，往下一望，蛮高的，想到了蹦极，虽然心里有那么点恐惧，但从这个高度，应该还是敢跳下去的。</p><p><img src="'+a+'" alt=""></p><p><img src="'+_+'" alt=""></p><p><img src="'+U+'" alt=""></p><p><img src="'+r+'" alt=""></p><p><img src="'+e+'" alt=""></p><p><img src="'+m+'" alt=""></p><p><img src="'+l+'" alt=""></p><p><img src="'+J+'" alt=""></p><p><img src="'+o+'" alt=""></p><p><img src="'+y+'" alt=""></p><p><img src="'+c+'" alt=""></p><p><img src="'+M+'" alt=""></p><p><img src="'+g+'" alt=""></p><p><img src="'+d+'" alt=""></p>',19),C=[V];function n(N,I,F,S,f,E){return i(),p("div",{"data-pagefind-body":!0,"data-pagefind-meta":"base64:"},C)}const x=t(T,[["render",n]]);export{O as __pageData,x as default};
